      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>

  <body>
    <div id="base" class="">

      <!-- Gogol Pica beaucoup black (Image) -->
      <div id="u0" class="ax_default image" data-label="Gogol Pica beaucoup black">
        <img id="u0_img" class="img " src="images/device_frame__complete_/gogol_pica_beaucoup_black_u0.png"/>
        <div id="u0_text" class="text " style="display:none; visibility: hidden">
          <p></p>
        </div>
      </div>

      <!-- content frame (Inline Frame) -->
      <div id="u1" class="ax_default" data-label="content frame">
        <iframe id="u1_input" data-label="content frame" scrolling="no" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>
      </div>

      <!-- Unnamed (Status Bar) -->

      <!-- Status Bar (Dynamic Panel) -->
      <div id="u3" class="ax_default" data-label="Status Bar">
        <div id="u3_state0" class="panel_state" data-label="Status Bar" style="">
          <div id="u3_state0_content" class="panel_state_content">

            <!-- Unnamed (Rectangle) -->
            <div id="u4" class="ax_default box_2">
              <div id="u4_div" class=""></div>
              <div id="u4_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- Time (Rectangle) -->
            <div id="u5" class="ax_default heading_1" data-label="Time">
              <div id="u5_div" class=""></div>
              <div id="u5_text" class="text ">
                <p><span style="text-decoration:none;">1:45</span></p>
              </div>
            </div>

            <!-- Status Battery Icon (Image) -->
            <div id="u6" class="ax_default image" data-label="Status Battery Icon">
              <img id="u6_img" class="img " src="images/device_frame__complete_/status_battery_icon_u6.png"/>
              <div id="u6_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- Status Wifi Icon (Image) -->
            <div id="u7" class="ax_default image" data-label="Status Wifi Icon">
              <img id="u7_img" class="img " src="images/device_frame__complete_/status_wifi_icon_u7.png"/>
              <div id="u7_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- Status Network Icon (Image) -->
            <div id="u8" class="ax_default image" data-label="Status Network Icon">
              <img id="u8_img" class="img " src="images/device_frame__complete_/status_network_icon_u8.png"/>
              <div id="u8_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- Time (Rectangle) -->
            <div id="u9" class="ax_default heading_1" data-label="Time">
              <div id="u9_div" class=""></div>
              <div id="u9_text" class="text ">
                <p><span style="text-decoration:none;">1:45</span></p>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div id="u2" style="display:none; visibility:hidden;"></div>
    </div>
    <script src="resources/scripts/axure/ios.js"></script>
